import React from 'react';
import './history.scss';


const History = (props) => {
  return (
    <div>
      <h3>History</h3>
      <section className="history">
        <ul>
        {Object.keys(sessionStorage).map((i, val) => {
          return (
            <li key={i}>{sessionStorage.getItem(i, val)} value={val}
            </li>
          );
        })}
        </ul>
      </section>
    </div>
  )
}

export default History;
